  render() {
    return (
      <div className="header-container">
        <header>
          <img src={ logoTunes } alt="Logo da TrybeTunes" />
          <div>
            <p>usuario</p>
          </div>
        </header>
        <nav>
          <h2><Link to="/Search">Pesquisa</Link></h2>
          <h2><Link to="/Likedsongs">Favoritas</Link></h2>
          <h2><Link to="/Profile">Perfil</Link></h2>
        </nav>
      </div>
    );
  }
}
